import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="text-center">
      <h2>Welcome to Pradhan Mantri Ujjwala Yojana</h2>
      <p className="lead">Apply online for LPG connection</p>
      <div className="d-flex justify-content-center gap-3 mt-4">
        <Link to="/apply" className="btn btn-success">Apply Now</Link>
        <Link to="/admin" className="btn btn-secondary">Admin Panel</Link>
      </div>
    </div>
  );
};

export default Home;
